package main

import (
  "encoding/base64"
)

// CaptchaFonts list of striped fonts for captchaUsage
var CaptchaFonts map[int][]byte
// FarsiCaptchaFonts list of striped fonts for captchaUsage
var FarsiCaptchaFonts map[int][]byte

func init() {
  CaptchaFonts = make(map[int][]byte)
  FarsiCaptchaFonts = make(map[int][]byte)
  FarsiCaptchaFonts[0], _ = base64.StdEncoding.DecodeString("")
  FarsiCaptchaFonts[1], _ = base64.StdEncoding.DecodeString("")
  CaptchaFonts[0], _ = base64.StdEncoding.DecodeString("")
  CaptchaFonts[1], _ = base64.StdEncoding.DecodeString("")
  CaptchaFonts[2], _ = base64.StdEncoding.DecodeString("")
  FarsiCaptchaFonts[2], _ = base64.StdEncoding.DecodeString("")
  FarsiCaptchaFonts[3], _ = base64.StdEncoding.DecodeString("")
  CaptchaFonts[3], _ = base64.StdEncoding.DecodeString("")
}